import React from "react";
import {
  withScriptjs,
  withGoogleMap,
  GoogleMap,
  Marker
} from "react-google-maps";
const {
  MarkerClusterer
} = require("react-google-maps/lib/components/addons/MarkerClusterer");

const onBoundsChanged = () => {
  //console.log(e);
  //const center = this.refs.map.getCenter();
  /* if (!center.equals(this.state.center)) {
     this.setState({ center });
   }
   */
};

const Map = withScriptjs(
  withGoogleMap(props => (
    <GoogleMap
      ref={map}
      defaultZoom={12}
      center={{
        lat: props.startLoc.lat,
        lng: props.startLoc.lng
      }}
      onBoundsChanged={onBoundsChanged}
      onClick={props.handleClickedMap}
    >
      <MarkerClusterer averageCenter enableRetinaIcons gridSize={15}>
        {props.isMarkerShown &&
          props.markers.map(marker => (
            <Marker
              position={{
                lat: marker.latitude,
                lng: marker.longtitude
              }}
            />
          ))}
      </MarkerClusterer>
    </GoogleMap>
  ))
);

export default Map;

